import "./App.css";
import Dictionary from "./Dictionary";

function App() {
  return (
    <div className="App">
      <div className="container">
        <header className="App-header">Dictionary</header>
        <main>
          <Dictionary />
        </main>
        <footer className="app-footer">Coded by Roberta Di Cio</footer>
      </div>
    </div>
  );
}

export default App;
